// src/pages/Gallery.js
import React, { useState } from 'react';
import PageHeader from '../components/layout/PageHeader';
import '../styles/pages/Gallery.css';

// Import all images from gallery folder
import img1 from '../public/images/Gallery/060524015.png';
import img2 from '../public/images/Gallery/20240409_153103.jpg';
import img3 from '../public/images/Gallery/DSC_0395.JPG';
import img4 from '../public/images/Gallery/DSC09116.jpg';
import img5 from '../public/images/Gallery/IMG_1405.HEIC';
import img6 from '../public/images/Gallery/IMG_1406.HEIC';
import img7 from '../public/images/Gallery/IMG_1451.HEIC';
import img8 from '../public/images/Gallery/IMG_1452.HEIC';
import img9 from '../public/images/Gallery/IMG_1455.HEIC';
import img10 from '../public/images/Gallery/IMG_2113.HEIC';
import img11 from '../public/images/Gallery/IMG_3876.CR2';
import img12 from '../public/images/Gallery/IMG_3952.CR2';
import img13 from '../public/images/Gallery/P1080810.JPG';
import img14 from '../public/images/Gallery/P1081099.JPG';
import img15 from '../public/images/Gallery/P1081106.JPG';
import img16 from '../public/images/Gallery/P1081132.JPG';
import img17 from '../public/images/Gallery/P1081152.JPG';
import img18 from '../public/images/Gallery/P1091479.JPG';
import img19 from '../public/images/Gallery/P1091499(1).JPG';
import img20 from '../public/images/Gallery/PXL_20240503_194311812.MP(1).jpg';
import img21 from '../public/images/Gallery/PXL_20241009_164720012.jpg';
import img22 from '../public/images/Gallery/PXL_20241011_114716623.jpg';
import img23 from '../public/images/Gallery/PXL_20250421_111514574~2.jpg';
import img24 from '../public/images/Gallery/PXL_20250421_111550904.MP~2.jpg';
import img25 from '../public/images/Gallery/received_323790254065392.jpeg';

const Gallery = () => {
  const [selectedImage, setSelectedImage] = useState(null);

  const galleryImages = [
    { id: 1, src: img1, alt: "Gallery Image 1" },
    { id: 2, src: img2, alt: "Gallery Image 2" },
    { id: 3, src: img3, alt: "Gallery Image 3" },
    { id: 4, src: img4, alt: "Gallery Image 4" },
    { id: 5, src: img5, alt: "Gallery Image 5" },
    { id: 6, src: img6, alt: "Gallery Image 6" },
    { id: 7, src: img7, alt: "Gallery Image 7" },
    { id: 8, src: img8, alt: "Gallery Image 8" },
    { id: 9, src: img9, alt: "Gallery Image 9" },
    { id: 10, src: img10, alt: "Gallery Image 10" },
    { id: 11, src: img11, alt: "Gallery Image 11" },
    { id: 12, src: img12, alt: "Gallery Image 12" },
    { id: 13, src: img13, alt: "Gallery Image 13" },
    { id: 14, src: img14, alt: "Gallery Image 14" },
    { id: 15, src: img15, alt: "Gallery Image 15" },
    { id: 16, src: img16, alt: "Gallery Image 16" },
    { id: 17, src: img17, alt: "Gallery Image 17" },
    { id: 18, src: img18, alt: "Gallery Image 18" },
    { id: 19, src: img19, alt: "Gallery Image 19" },
    { id: 20, src: img20, alt: "Gallery Image 20" },
    { id: 21, src: img21, alt: "Gallery Image 21" },
    { id: 22, src: img22, alt: "Gallery Image 22" },
    { id: 23, src: img23, alt: "Gallery Image 23" },
    { id: 24, src: img24, alt: "Gallery Image 24" },
    { id: 25, src: img25, alt: "Gallery Image 25" }
  ];

  const openModal = (image) => {
    setSelectedImage(image);
    document.body.classList.add('modal-open');
  };

  const closeModal = () => {
    setSelectedImage(null);
    document.body.classList.remove('modal-open');
  };

  return (
    <div className="gallery-page">
      <PageHeader title="Fotogalerij" subtitle="Een verzameling van mijn fotografie" />

      <div className="container gallery-container">
        <div className="gallery-grid">
          {galleryImages.map((image) => (
            <div key={image.id} className="gallery-item" onClick={() => openModal(image)}>
              <img src={image.src} alt={image.alt} className="gallery-image" />
            </div>
          ))}
        </div>
      </div>

      {selectedImage && (
        <div className="image-modal" onClick={closeModal}>
          <div className="modal-content" onClick={(e) => e.stopPropagation()}>
            <span className="close-modal" onClick={closeModal}>&times;</span>
            <img src={selectedImage.src} alt={selectedImage.alt} className="modal-image" />
          </div>
        </div>
      )}
    </div>
  );
};

export default Gallery;
